import React from 'react';

import * as S from './styles'

const Solutions: React.FC = () => {
  return (
    <S.Container>
      <S.Title>Produtos</S.Title>
      <S.Description>
        We are a team of designers and developers that create beautiful and
        functional products.
      </S.Description>
    </S.Container>
  )
}

export default Solutions;
